import React from 'react';
import ReactDOM from 'react-dom';

const myelement = (
  <div>
  <table>
    <tr>
      <th>Name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
    <tr>
      <td>Elsa</td>
    </tr>
  </table>
  <div> KnowThyself </div>
  </div>
);

ReactDOM.render(myelement, document.getElementById('root'));
